import React from "react";
import { useForm } from "react-hook-form";
import useAuth from "../../hooks/useAuth";
import useaxiosInstance from "../../hooks/useAxios";
import { toast } from "react-toastify";
import Swal from "sweetalert2";

const categories = [
    "water",
    "roads",
    "lightning",
    "sanitation",
    "sidewalks",
    "traffic",
    "park",
];

export default function StaffRegister() {
    const {
        register,
        handleSubmit,
        reset,
        formState: { errors },
    } = useForm();
    const { user } = useAuth();
    const axiosInstance = useaxiosInstance();

    const handleStaffReg = (data) => {
        const newStaff = {
            ...data,
            name: user.displayName,
            email: user.email,
        };
        console.log("newStaff", newStaff);
        axiosInstance
            .post("/staffs", newStaff)
            .then((res) => {
                if (res.data.insertedId) {
                    Swal.fire({
                        title: "Registration Complete!",
                        text: "Your application as a staff has been sent",
                        icon: "success",
                    });

                    reset();
                } else {
                    Swal.fire({
                        title: "Aleardy applied!",
                        text: "You have aleardy applied",
                        icon: "error",
                    });
                }
            })
            .catch((err) => {
                console.log("", err);
                toast.error(err.message);
            });
    };

    return (
        <div className="max-w-375 mx-auto p-10 bg-base-200">
            <h2 className="text-3xl font-semibold">Staff Registration</h2>
            <div className="flex flex-col-reverse md:flex-row gap-5">
                <fieldset className="w-full flex-1 fieldset bg-base-300 border-base-300 shadow-lg rounded-box border p-4 mt-3">
                    {/* <legend className="fieldset-legend">Login</legend> */}

                    <form
                        onSubmit={handleSubmit(handleStaffReg)}
                        className="space-y-2.5"
                    >
                        <div className="space-y-1 flex flex-col">
                            <label className="label text-xl">Age</label>
                            <input
                                {...register("age", { required: true })}
                                type="text"
                                className="input w-full"
                                placeholder="Age"
                            />
                            {errors?.age?.type === "required" && (
                                <p className="text-error">Age is required</p>
                            )}
                        </div>

                        <div className="space-y-1 flex flex-col">
                            <label className="label text-xl">
                                Preferred Category
                            </label>
                            <select
                                {...register("category", { required: true })}
                                defaultValue=""
                                className="select w-full"
                            >
                                <option value="" disabled>
                                    Pick a category
                                </option>
                                {categories.map((category) => (
                                    <option key={category}>
                                        {category.charAt(0).toUpperCase() +
                                            category.slice(1)}
                                    </option>
                                ))}
                            </select>
                            {errors?.category?.type === "required" && (
                                <p className="text-error">
                                    Category is required
                                </p>
                            )}
                        </div>

                        {/* <label className="label text-xl">Email</label>
                    <input
                        {...register("email")}
                        type="email"
                        className="input"
                        placeholder="Email"
                    /> */}

                        <div className="space-y-1 flex flex-col">
                            <label className="label text-xl">Phone</label>
                            <input
                                {...register("phone", { required: true })}
                                type="text"
                                className="input w-full"
                                placeholder="Phone"
                            />
                            {errors?.phone?.type === "required" && (
                                <p className="text-error">Phone is required</p>
                            )}
                        </div>

                        <button className="w-full btn btn-primary mt-4">
                            Register as Staff
                        </button>
                    </form>
                </fieldset>
                <div className="md:flex-1 h-96">
                    <img
                    className="w-full h-full"
                        src="data:image/svg+xml;base64,"
                        alt=""
                    />
                </div>
            </div>
        </div>
    );
}
